import { Component } from "react"
import Deals from "../pages/Deals"
import Auth from "../pages/Auth"
import { AUTH_ROUTE, DEALS_ROUTE } from "./consts"

export const authRoutes = [
  {
    path: DEALS_ROUTE,
    Component: Deals
  }
]

export const publicRoutes = [
  {
    path: AUTH_ROUTE,
    Component: Auth
  }
]
